INSERT INTO `movies` (`id`, `name`, `duration`, `synopsis`, `country`, `trailer`, `year`, `director_id`, `created_at`, `updated_at`, `deleted_at`, `poster`, `genre_id`, `slug`) VALUES
(1, 'Avengers Endgame', '182', 'Después de los eventos devastadores de \'Avengers: Infinity War\', el universo está en ruinas debido a las acciones de Thanos, el Titán Loco. Con la ayuda de los aliados que quedaron, los Vengadores deberán reunirse una vez más para intentar deshacer sus acciones y restaurar el orden en el universo de una vez por todas, sin importar cuáles son las consecuencias... Cuarta y última entrega de la saga \"Vengadores\".', 'EE.UU.', '{\"provider\":\"youtube\",\"id\":\"0jNvJU52LvU\",\"title\":\"Marvel Studios’ Avengers: Endgame | “To the End”\",\"image\":\"https://i.ytimg.com/vi/0jNvJU52LvU/maxresdefault.jpg\",\"url\":\"https://www.youtube.com/watch?v=0jNvJU52LvU\"}', '2019', 1, '2019-04-28 10:35:40', '2019-05-02 02:38:23', NULL, 'data:image/jpeg;base64,', 5, 'avengers-endgame');
INSERT INTO `movies` (`id`, `name`, `duration`, `synopsis`, `country`, `trailer`, `year`, `director_id`, `created_at`, `updated_at`, `deleted_at`, `poster`, `genre_id`, `slug`) VALUES
(2, 'E.T. El Extraterrestre', '121', 'Un pequeño ser de otro planeta se queda abandonado en la Tierra cuando su nave, al emprender el regreso, se olvida de él. Está completamente solo y tiene miedo, pero se hará amigo de un niño, que lo esconde en su casa. El pequeño y sus hermanos intentan encontrar la forma de que el pequeño extraterrestre regrese a su planeta antes de que lo encuentren los científicos y la policía. (FILMAFFINITY)', 'EE.UU.', '{\"provider\":\"youtube\",\"id\":\"MwNuAz-Yt8k\",\"title\":\"E.T. El Extraterrestre (Trailer 20º Aniversario 2002 subtitulado en español)\",\"image\":\"https://i.ytimg.com/vi/MwNuAz-Yt8k/maxresdefault.jpg\",\"url\":\"https://www.youtube.com/watch?v=MwNuAz-Yt8k\"}', '1982', 3, '2019-05-01 21:40:01', '2019-05-02 02:40:02', NULL, 'data:image/jpeg;base64,', 10, 'et-el-extraterrestre');
INSERT INTO `movies` (`id`, `name`, `duration`, `synopsis`, `country`, `trailer`, `year`, `director_id`, `created_at`, `updated_at`, `deleted_at`, `poster`, `genre_id`, `slug`) VALUES
(3, 'Tiburón', '124', 'En la costa de un pequeño pueblo del Este de los Estados Unidos, un enorme tiburón ataca a varias personas. Por temor a los nefastos efectos que este hecho podría tener sobre el negocio turístico, el alcalde se niega a cerrar las playas y a difundir la noticia. Pero un nuevo ataque del tiburón termina con la vida de un bañista. Cuando el terror se apodera de todos, un veterano cazador de tiburones, un oceanógrafo y el jefe de la policía local se unen para capturar al escualo.', 'EE.UU.', '{\"provider\":\"youtube\",\"id\":\"JvF0ECpkrqw\",\"title\":\"Trailer Tiburon HD 1975\",\"image\":\"https://i.ytimg.com/vi/JvF0ECpkrqw/maxresdefault.jpg\",\"url\":\"https://www.youtube.com/watch?v=JvF0ECpkrqw\"}', '1975', 3, '2019-05-01 21:52:05', '2019-05-02 02:40:38', NULL, 'data:image/jpeg;base64,', 16, 'tiburon');
INSERT INTO `movies` (`id`, `name`, `duration`, `synopsis`, `country`, `trailer`, `year`, `director_id`, `created_at`, `updated_at`, `deleted_at`, `poster`, `genre_id`, `slug`) VALUES
(4, 'Avatar', '161', 'Año 2154. Jake Sully (Sam Worthington), un ex-marine condenado a vivir en una silla de ruedas, sigue siendo, a pesar de ello, un auténtico guerrero. Precisamente por ello ha sido designado para ir a Pandora, donde algunas empresas están extrayendo un mineral extraño que podría resolver la crisis energética de la Tierra. Para contrarrestar la toxicidad de la atmósfera de Pandora, se ha creado el programa Avatar, gracias al cual los seres humanos mantienen sus conciencias unidas a un avatar: un cuerpo biológico controlado de forma remota que puede sobrevivir en el aire letal. Esos cuerpos han sido creados con ADN humano, mezclado con ADN de los nativos de Pandora, los Na\'vi. Convertido en avatar, Jake puede caminar otra vez. Su misión consiste en infiltrarse entre los Na\'vi, que se han convertido en el mayor obstáculo para la extracción del mineral. Pero cuando Neytiri, una bella Na\'vi (Zoe Saldana), salva la vida de Jake, todo cambia: Jake, tras superar ciertas pruebas, es admitido en su clan. Mientras tanto, los hombres esperan los resultados de la misión de Jake.', 'EE.UU.', '{\"provider\":\"youtube\",\"id\":\"tLylzuf1MWA\",\"title\":\"AVATAR - SPECIAL EDITION\",\"image\":\"https://i.ytimg.com/vi/tLylzuf1MWA/maxresdefault.jpg\",\"url\":\"https://www.youtube.com/watch?v=tLylzuf1MWA\"}', '2009', 2, '2019-05-01 21:55:18', '2019-05-02 02:42:02', NULL, 'data:image/jpeg;base64,', 5, 'avatar');
INSERT INTO `movies` (`id`, `name`, `duration`, `synopsis`, `country`, `trailer`, `year`, `director_id`, `created_at`, `updated_at`, `deleted_at`, `poster`, `genre_id`, `slug`) VALUES
(5, 'Titanic', '195', 'Jack (DiCaprio), un joven artista, gana en una partida de cartas un pasaje para viajar a América en el Titanic, el transatlántico más grande y seguro jamás construido. A bordo conoce a Rose (Kate Winslet), una joven de una buena familia venida a menos que va a contraer un matrimonio de conveniencia con Cal (Billy Zane), un millonario engreído a quien sólo interesa el prestigioso apellido de su prometida. Jack y Rose se enamoran, pero el prometido y la madre de ella ponen todo tipo de trabas a su relación. Mientras, el gigantesco y lujoso transatlántico se aproxima hacia un inmenso iceberg.', 'EE.UU.', '{\"provider\":\"youtube\",\"id\":\"FiRVcExwBVA\",\"title\":\"Titanic 3D - Tráiler en español\",\"image\":\"https://i.ytimg.com/vi/FiRVcExwBVA/maxresdefault.jpg\",\"url\":\"https://www.youtube.com/watch?v=FiRVcExwBVA\"}', '1997', 2, '2019-05-01 21:58:15', '2019-05-02 02:42:39', NULL, 'data:image/jpeg;base64,', 15, 'titanic');
INSERT INTO `movies` (`id`, `name`, `duration`, `synopsis`, `country`, `trailer`, `year`, `director_id`, `created_at`, `updated_at`, `deleted_at`, `poster`, `genre_id`, `slug`) VALUES
(6, 'Tiempos Violentos', '153', 'Jules y Vincent, dos asesinos a sueldo con no demasiadas luces, trabajan para el gángster Marsellus Wallace. Vincent le confiesa a Jules que Marsellus le ha pedido que cuide de Mia, su atractiva mujer. Jules le recomienda prudencia porque es muy peligroso sobrepasarse con la novia del jefe. Cuando llega la hora de trabajar, ambos deben ponerse \"manos a la obra\". Su misión: recuperar un misterioso maletín.', 'EE.UU.', '{\"provider\":\"youtube\",\"id\":\"LI1yt38A9-E\",\"title\":\"Pulp Fiction (1994) - Opening Credits\",\"image\":\"https://i.ytimg.com/vi/LI1yt38A9-E/maxresdefault.jpg\",\"url\":\"https://www.youtube.com/watch?v=LI1yt38A9-E\"}', '1994', 4, '2019-05-01 22:00:44', '2019-05-02 02:43:39', NULL, 'data:image/jpeg;base64,', 17, 'tiempos-violentos');
INSERT INTO `movies` (`id`, `name`, `duration`, `synopsis`, `country`, `trailer`, `year`, `director_id`, `created_at`, `updated_at`, `deleted_at`, `poster`, `genre_id`, `slug`) VALUES
(7, 'Perros de Reserva', '99', 'Una banda organizada es contratada para atracar una empresa y llevarse unos diamantes. Sin embargo, antes de que suene la alarma, la policía ya está allí. Algunos miembros de la banda mueren en el enfrentamiento con las fuerzas del orden, y los demás se reúnen en el lugar convenido', 'EE.UU.', '{\"provider\":\"youtube\",\"id\":\"OXqI6CrT9Fg\",\"title\":\"Reservoir Dogs (trailer en castellano)\",\"image\":\"https://i.ytimg.com/vi/OXqI6CrT9Fg/default.jpg\",\"url\":\"https://www.youtube.com/watch?v=OXqI6CrT9Fg\"}', '1992', 4, '2019-05-01 22:02:27', '2019-05-02 02:44:48', NULL, 'data:image/jpeg;base64,', 17, 'perros-de-reserva');
INSERT INTO `movies` (`id`, `name`, `duration`, `synopsis`, `country`, `trailer`, `year`, `director_id`, `created_at`, `updated_at`, `deleted_at`, `poster`, `genre_id`, `slug`) VALUES
(9, 'Killl Bill', '150', 'Killbill mata a medio mundo', 'EE.UU.', '{\"provider\":\"vimeo\",\"id\":92251044,\"title\":\"killbill c10 Awareness Campaign\",\"image\":\"https://i.vimeocdn.com/video/471924222_640.jpg\",\"url\":\"https://vimeo.com/92251044\"}', '2004', 4, '2019-05-02 20:19:31', '2019-05-02 20:19:31', NULL, 'data:image/jpeg;base64,', 17, 'killl-bill');

